  elseif _ARG_0_ == UIEnums.Message.ButtonY then
    if UIGlobals.SpLeaderboardInCarousel == true then
      if UIGlobals.SpLeaderboardCarouselFocusOnMenu == true then
        UIButtons.SetSelected(SCUI.name_to_id.node_list, false)
