      end
      MpLeadboard_SetupInfoLines()
      PlaySfxToggle()
    end
  elseif _ARG_0_ == UIEnums.Message.ButtonLeftTrigger then
    if GUI.reading_scoreboard == false and 0 > GUI.read_cooldown and MpLeaderboard_CanPageUp() == true then
      UISystem.PlaySound(UIEnums.SoundEffect.Filter)
