  elseif _ARG_0_ == UIEnums.Message.ButtonRightShoulder and _ARG_2_ == true then
    if false == true and GUI.scoreboard_type == GUI.scoreboard.friends and GUI.scoreboard_offset + UIButtons.GetSelection(SCUI.name_to_id.node_list) ~= GUI.row_me and 0 < GUI.scoreboard_total_rows then
      UISystem.PlaySound(UIEnums.SoundEffect.Choose)
