      elseif UIButtons.GetSelection(SCUI.name_to_id.node_list) < GUI.row_me then
        Amax.CreateBlurb(UIEnums.SocialNetworkingItemType.RelativeLeaderboardPositionBelow, 1, (UIButtons.GetSelection(SCUI.name_to_id.node_list)))
      end
      GoScreen("Shared\\Facebook.lua", UIEnums.Context.Blurb)
